import React from "react";

function MatchPage({matched, setMatch}) {

    return (
        <Container>
        <Row>
              {matched.map((cat) => (
              <Col sm key={cat.id}> 
                          <CatCard 
                              id={cat.id}
                              image={cat.url}
                              name={cat.name}
                              favoritemovie={cat.favoriteMovie}
                              age={cat.age}
                              pickupLine={cat.pickupLine}
                              matched={matched} 
                              setMatch={setMatch}
                          />
              </Col>
          ))}
        </Row>
      </Container>
    ) 
}

export default MatchPage
